import http from 'k6/http';
import { check, sleep, group } from 'k6';
import { Counter, Rate, Trend } from 'k6/metrics';
import { randomItem } from 'https://jslib.k6.io/k6-utils/1.2.0/index.js';
import { htmlReport } from "https://raw.githubusercontent.com/benc-uk/k6-reporter/main/dist/bundle.js";
import { textSummary } from "https://jslib.k6.io/k6-summary/0.0.1/index.js";

// custom metrics in the init context
const errorRate = new Rate('error_rate');

// route response time metrics
const adminListResponseTime = new Trend('response_time_admins');
const adminDetailResponseTime = new Trend('response_time_admins_email');
const roverFlowerImagesResponseTime = new Trend('response_time_rovers_flower_images');
const userEmailResponseTime = new Trend('response_time_users_email');
const userIdResponseTime = new Trend('response_time_users_user_id');
const usernameResponseTime = new Trend('response_time_users_username');
const userRoverFlowerImagesResponseTime = new Trend('response_time_users_rovers_flower_images');
const flowerDetectionResponseTime = new Trend('response_time_find_flower_yolo');

// Configuration
const BASE_URL = 'http://127.0.0.1:8000';
const USER_IDS = ['1', '1738508474960', '1739813693221'];
const ROVER_IDS = ['1', '101', '20'];
const USER_EMAILS = ['something@gmail.com', 'akmal@gmail.com'];
const ADMIN_EMAIL = 'john.doe@example.com';
const USERNAMES = ['testuser1', 'testuser2', 'nonexistentuser'];

// test base64 image
const BASE64_IMAGE = "data:image/jpeg;base64,";

export const options = {
  scenarios: {
    api_load_test: {
      executor: 'ramping-vus',
      startVUs: 5,
      stages: [
        { duration: '30s', target: 10 },
        { duration: '1m', target: 15 },
        { duration: '1m', target: 15 },
        { duration: '30s', target: 0 },
      ],
    },
    high_priority_test: {
      executor: 'constant-vus',
      vus: 5,
      duration: '1m',
      tags: { priority_test: 'high' },
    },
    rover_specific_test: {
      executor: 'per-vu-iterations',
      vus: 3,
      iterations: 8,
      maxDuration: '1m30s',
      tags: { test_type: 'rover_focused' },
    }
  },
  thresholds: {
    'http_req_duration{priority_test:high}': ['p(95) < 2000'],
    'error_rate': ['rate < 0.15'],
  },
};

export default function () {
  const testTag = __ENV.SCENARIO || 'api_load_test';
  
  if (testTag === 'high_priority_test') {
    highPriorityLoadTest();
  } else if (testTag === 'rover_specific_test') {
    roverLoadTest();
  } else {
    generalApiLoadTest();
  }
  
  sleep(Math.random() * 3 + 1);
}

function generalApiLoadTest() {
  group('GET Endpoints', function () {
    // Test admin endpoints
    testGetEndpoint('/admins', 'Admin List', adminListResponseTime);
    testGetEndpoint(`/admins/${ADMIN_EMAIL}`, 'Admin Detail', adminDetailResponseTime);
    
    // Test rover endpoints
    const roverId = randomItem(ROVER_IDS);
    testGetEndpoint(`/rovers/flower-images/${roverId}`, 'Rover Flower Images', roverFlowerImagesResponseTime);
    
    // Test user endpoints
    const userId = randomItem(USER_IDS);
    const userEmail = randomItem(USER_EMAILS);
    const username = randomItem(USERNAMES);
    
    testGetEndpoint(`/users/email/${userEmail}`, 'User by Email', userEmailResponseTime);
    testGetEndpoint(`/users/user-id/${userId}`, 'User by ID', userIdResponseTime);
    testGetEndpoint(`/users/username/${username}`, 'User by Username', usernameResponseTime);
    testGetEndpoint(`/users/rovers/flower-images/${roverId}`, 'User Rover Flower Images', userRoverFlowerImagesResponseTime);
  });
  
  // flower detection endpoint test
  group('Flower Detection POST', function() {
    testFlowerDetection();
  });
}

function highPriorityLoadTest() {
  // focus on high priority routes
  testFlowerDetection({ priority_test: 'high' });
}

function roverLoadTest() {
  // create load on specific rovers
  const roverId = randomItem(ROVER_IDS);
  
  testGetEndpoint(`/rovers/flower-images/${roverId}`, 'Rover Load Test', roverFlowerImagesResponseTime, { test_type: 'rover_focused' });
  testGetEndpoint(`/users/rovers/flower-images/${roverId}`, 'User Rover Load Test', userRoverFlowerImagesResponseTime, { test_type: 'rover_focused' });
  
  testFlowerDetection({ test_type: 'rover_focused', rover_id: roverId });
}

function testGetEndpoint(path, name, responseTimeTrend, tags = {}) {
  const url = `${BASE_URL}${path}`;
  const params = {
    tags: { route: path, ...tags },
    timeout: '60s' // just trying to get the timings here
  };
  
  const response = http.get(url, params);
  
  responseTimeTrend.add(response.timings.duration);
  
  const success = check(response, {
    [`${name} status is 200 or 404`]: (r) => r.status === 200 || r.status === 404,
  });
  
  errorRate.add(!success);
}

function testFlowerDetection(tags = {}) {
  const url = `${BASE_URL}/find-flower-yolo`;
  const roverId = tags.rover_id || randomItem(ROVER_IDS);
  
  const payload = JSON.stringify({
    image: BASE64_IMAGE,
    rover_id: parseInt(roverId)
  });
  
  const params = {
    headers: {
      'Content-Type': 'application/json',
    },
    tags: { route: '/find-flower-yolo', ...tags },
    timeout: '10s' // timeout I set lower hear because it's the fast one I'm looking for
  };
  
  const response = http.post(url, payload, params);
  flowerDetectionResponseTime.add(response.timings.duration);
  
  const success = check(response, {
    'Flower detection status is 200 or 404': (r) => r.status === 200 || r.status === 404,
  });
  
  errorRate.add(!success);
}

export function handleSummary(data) {
  return {
    'scheduler_load_test_summary.html': htmlReport(data),
    'scheduler_load_test_summary.json': JSON.stringify(data),
    'stdout': textSummary(data, { indent: ' ', enableColors: true }),
  };
}